import './App.css';
import { Button, SVGIcon } from 'react-md';
import img from './Assets/logo.png';

function MainPage(props){
    
    return(
        <div id="container">
            {/* <img src={img} height="60px" /> */}

            <header className="header">
                <div className="contHeaderBtn">
                    <span class="material-icons-outlined">
                        search
                    </span>
                    <Button flat secondary iconBefore={false} >Clientes</Button>                    <p>Servicos</p>
                    <p>Financeiro</p>
                </div>


            </header>

            <body className="body">
                <div>

                </div>
            </body>

          
        </div>
    );
}

export default MainPage;
